0gwPPmIPQBA\\u0026plid=AAWkp5jkcGeU3Jps\\u0026video_id=N5-KubFjtHc\",\"elapsedMediaTimeSeconds\":120},\"atrUrl\":{\"baseUrl\":\"https:\/\/s.youtube.com\/api\/stats\/atr?docid=N5-KubFjtHc\\u0026ei=l0itXsePB9C0gwPPmIPQBA\\u0026len=340\\u0026ns=yt\\u0026plid=AAWkp5jkcGeU3Jps\\u0026ver=2\",\"elapsedMediaTimeSeconds\":5}},\"videoDetails\":{\"videoId\":\"N5-KubFjtHc\",\"title\":\"Vaccines part 2 - properties of vaccine\",\"lengthSeconds\":\"339\",\"keywords\":[\"Mumps\",\"molecular biology\",\"Oral Vaccine\",\"DNA\",\"Immunogen\",\"life sciences\",\"Dna Vaccine\",\"shomu's biology\",\"Inactivated Vaccine\",\"Immune System\",\"Conjugated Vaccine\",\"proteins\",\"Antigen\",\"Killed Vaccine\",\"Introduction To Vaccination\",\"Vaccination\",\"Disease\",\"Development Of Vaccine\",\"suman bhattacharjee\",\"biology education\",\"Viral Vaccine\",\"cell biology\",\"Allergen\",\"Polio Vaccine\",\"Vaccination Process\",\"Immune Response\",\"Hapten\",\"Live Attenuated Vaccine\",\"Subunit Vaccine\",\"Vaccine\",\"teaching\"],\"channelId\":\"UCEPMCywJ6FPZpQ_aPEZt5JA\",\"isOwnerViewing\":false,\"shortDescription\":\"For more information, log on to-\\nhttp:\/\/shomusbiology.weebly.com\/\\nDownload the study materials here-\\nhttp:\/\/shomusbiology.weebly.com\/bio-materials.html\\nVaccines work by presenting a foreign antigen to the immune system to evoke an immune response, but there are several ways to do this. Four main types are currently in clinical use:\\n\\n    An inactivated vaccine consists of virus or bacteria that are grown in culture and then killed using a method such as heat or formaldehyde. Although the virus or bacteria particles are destroyed and cannot replicate, the virus capsid proteins or bacterial wall are intact enough to be recognized and remembered by the immune system and evoke a response. When manufactured correctly, the vaccine is not infectious, but improper inactivation can result in intact and infectious particles. Since the properly produced vaccine does not reproduce, booster shots are required periodically to reinforce the immune response.\\n    In an attenuated vaccine, live virus or bacteria with very low virulence are administered. They will replicate, but locally or very slowly. Since they do reproduce and continue to present antigen to the immune system beyond the initial vaccination, boosters may be required less often. These vaccines may be produced by passaging, for example, adapting a virus into different host cell cultures, such as in animals, or at suboptimal temperatures, allowing selection of less virulent strains, or by mutagenesis or targeted deletions in genes required for virulence. There is a small risk of reversion to virulence, which is smaller in vaccines with deletions. Attenuated vaccines also cannot be used by immunocompromised individuals. Reversions of virulence were described for a few attenuated viruses of chickens (infectious bursal disease virus, avian infectious bronchitis virus, avian infectious laryngotracheitis virus [3], avian metapneumovirus [4])[21]\\n    Virus-like particle vaccines consist of viral protein(s) derived from the structural proteins of a virus. These proteins can self-assemble into particles that resemble the virus from which they were derived but lack viral nucleic acid, meaning that they are not infectious. Because of their highly repetitive, multivalent structure, virus-like particles are typically more immunogenic than subunit vaccines (described below). The human papillomavirus and Hepatitis B virus vaccines are two virus-like particle-based vaccines currently in clinical use.\\n    A subunit vaccine presents an antigen to the immune system without introducing viral particles, whole or otherwise. One method of production involves isolation of a specific protein from a virus or bacterium (such as a bacterial toxin) and administering this by itself. A weakness of this technique is that isolated proteins may have a different three-dimensional structure than the protein in its normal context, and will induce antibodies that may not recognize the infectious organism. In addition, subunit vaccines often elicit weaker antibody responses than the other classes of vaccines.\\n\\nA number of other vaccine strategies are under experimental investigation. These include DNA vaccination and recombinant viral vectors. Source of the article published in description is Wikipedia. I am sharing their material. Copyright by original content developers of Wikipedia.\\nLink- http:\/\/en.wikipedia.org\/wiki\/Main_Page\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/N5-KubFjtHc\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLC4lcA2_ZenLEun5s9bRI6aH9FM2A\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/N5-KubFjtHc\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLBs4c1_orpS5MH6d39qzHs82AG-XQ\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/N5-KubFjtHc\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLB8mRtAisc6UI4EjjgtsdqtWfunSA\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/N5-KubFjtHc\/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLC8b-3-qkE5SzVnGoKMhtVVHqFq8Q\",\"width\":336,\"height\":188}]},\"averageRating\":4.8567495,\"allowRatings\":true,\"viewCount\":\"41882\",\"author\":\"Shomu's Biology\",\"isPrivate\":false,\"isUnpluggedCorpus\":false,\"isLiveContent\":false},\"annotations\":[{\"playerAnnotationsExpandedRenderer\":{\"featuredChannel\":{\"startTimeMs\":\"0\",\"endTimeMs\":\"340000\",\"watermark\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/an\/EPMCywJ6FPZpQ_aPEZt5JA\/featured_channel.jpg?v=550e4c95\",\"width\":51,\"height\":23}]},\"trackingParams\":\"CBQQ8zciEwiHt4_H-ZTpAhVQ2mAKHU_MAEo=\",\"navigationEndpoint\":{\"clickTrackingParams\":\"CBQQ8zciEwiHt4_H-ZTpA }},\"storyboards\":{\"playerStoryboardSpecRenderer\":{\"spec\":\"https:\/\/i9.ytimg.com\/sb\/N5-KubFjtHc\/storyboard3_L$L\/$N.jpg?sqp=ovOX_wMGCNnRl6AF|48#27#100#10#10#0#default#rs$AOn4CLCWusoB_SvpMLIoSzH0O-okKEOAYg|60#45#69#10#10#5000#M$M#rs$AOn4CLBXXqwYzVVGd0JX3OHrDZkra-VfIg|120#90#69#5#5#5000#M$M#rs$AOn4CLDjaZsDL2Nus4hC37Nqs2aQVyvasg\"}},\"microformat\":{\"playerMicroformatRenderer\":{\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/N5-KubFjtHc\/hqdefault.jpg\",\"width\":480,\"height\":360}]},\"embed\":{\"iframeUrl\":\"https:\/\/www.youtube.com\/embed\/N5-KubFjtHc\",\"flashUrl\":\"http:\/\/www.youtube.com\/v\/N5-KubFjtHc?version=3\\u0026autohide=1\",\"width\":480,\"height\":360,\"flashSecureUrl\":\"https:\/\/www.youtube.com\/v\/N5-KubFjtHc?version=3\\u0026autohide=1\"},\"title\":{\"simpleText\":\"Vaccines part 2 - properties of vaccine\"},\"description\":{\"simpleText\":\"For more information, log on to-\\nhttp:\/\/shomusbiology.weebly.com\/\\nDownload the study materials here-\\nhttp:\/\/shomusbiology.weebly.com\/bio-materials.html\\nVaccines work by presenting a foreign antigen to the immune system to evoke an immune response, but there are several ways to do this. Four main types are currently in clinical use:\\n\\n    An inactivated vaccine consists of virus or bacteria that are grown in culture and then killed using a method such as heat or formaldehyde. Although the virus or bacteria particles are destroyed and cannot replicate, the virus capsid proteins or bacterial wall are intact enough to be recognized and remembered by the immune system and evoke a response. When manufactured correctly, the vaccine is not infectious, but improper inactivation can result in intact and infectious particles. Since the properly produced vaccine does not reproduce, booster shots are required periodically to reinforce the immune response.\\n    In an attenuated vaccine, live virus or bacteria with very low virulence are administered. They will replicate, but locally or very slowly. Since they do reproduce and continue to present antigen to the immune system beyond the initial vaccination, boosters may be required less often. These vaccines may be produced by passaging, for example, adapting a virus into different host cell cultures, such as in animals, or at suboptimal temperatures, allowing selection of less virulent strains, or by mutagenesis or targeted deletions in genes required for virulence. There is a small risk of reversion to virulence, which is smaller in vaccines with deletions. Attenuated vaccines also cannot be used by immunocompromised individuals. Reversions of virulence were described for a few attenuated viruses of chickens (infectious bursal disease virus, avian infectious bronchitis virus, avian infectious laryngotracheitis virus [3], avian metapneumovirus [4])[21]\\n    Virus-like particle vaccines consist of viral protein(s) derived from the structural proteins of a virus. These proteins can self-assemble into particles that resemble the virus from which they were derived but lack viral nucleic acid, meaning that they are not infectious. Because of their highly repetitive, multivalent structure, virus-like particles are typically more immunogenic than subunit vaccines (described below). The human papillomavirus and Hepatitis B virus vaccines are two virus-like particle-based vaccines currently in clinical use.\\n    A subunit vaccine presents an antigen to the immune system without introducing viral particles, whole or otherwise. One method of production involves isolation of a specific protein from a virus or bacterium (such as a bacterial toxin) and administering this by itself. A weakness of this technique is that isolated proteins may have a different three-dimensional structure than the protein in its normal context, and will induce antibodies that may not recognize the infectious organism. In addition, subunit vaccines often elicit weaker antibody responses than the other classes of vaccines.\\n\\nA number of other vaccine strategies are under experimental investigation. These include DNA vaccination and recombinant viral vectors. Source of the article published in description is Wikipedia. I am sharing their material. Copyright by original content developers of Wikipedia.\\nLink- http:\/\/en.wikipedia.org\/wiki\/Main_Page\"},\"lengthSeconds\":\"340\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/TheFunsuman\",\"externalChannelId\":\"UCEPMCywJ6FPZpQ_aPEZt5JA\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\",\"EC\",\"EE\",\"EG\",\"EH\",\"ER\",\"ES\",\"ET\",\"FI\",\"FJ\",\"FK\",\"FM\",\"FO\",\"FR\",\"GA\",\"GB\",\"GD\",\"GE\",\"GF\",\"GG\",\"GH\",\"GI\",\"GL\",\"GM\",\"GN\",\"GP\",\"GQ\",\"GR\",\"GS\",\"GT\",\"GU\",\"GW\",\"GY\",\"HK\",\"HM\",\"HN\",\"HR\",\"HT\",\"HU\",\"ID\",\"IE\",\"IL\",\"IM\",\"IN\",\"IO\",\"IQ\",\"IR\",\"IS\",\"IT\",\"JE\",\"JM\",\"JO\",\"JP\",\"KE\",\"KG\",\"KH\",\"KI\",\"KM\",\"KN\",\"KP\",\"KR\",\"KW\",\"KY\",\"KZ\",\"LA\",\"LB\",\"LC\",\"LI\",\"LK\",\"LR\",\"LS\",\"LT\",\"LU\",\"LV\",\"LY\",\"MA\",\"MC\",\"MD\",\"ME\",\"MF\",\"MG\",\"MH\",\"MK\",\"ML\",\"MM\",\"MN\",\"MO\",\"MP\",\"MQ\",\"MR\",\"MS\",\"MT\",\"MU\",\"MV\",\"MW\",\"MX\",\"MY\",\"MZ\",\"NA\",\"NC\",\"NE\",\"NF\",\"NG\",\"NI\",\"NL\",\"NO\",\"NP\",\"NR\",\"NU\",\"NZ\",\"OM\",\"PA\",\"PE\",\"PF\",\"PG\",\"PH\",\"PK\",\"PL\",\"PM\",\"PN\",\"PR\",\"PS\",\"PT\",\"PW\",\"PY\",\"QA\",\"RE\",\"RO\",\"RS\",\"RU\",\"RW\",\"SA\",\"SB\",\"SC\",\"SD\",\"SE\",\"SG\",\"SH\",\"SI\",\"SJ\",\"SK\",\"SL\",\"SM\",\"SN\",\"SO\",\"SR\",\"SS\",\"ST\",\" Params":"CJQBEM2rARgBIhMIv9GPx_mU6QIVGNDBCh2GDg4cSPfojoub1-LPNw==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?event=video_description\u0026v=N5-KubFjtHc\u0026redir_token=962PqshVlTHnPz8tg8dTFphkPgF8MTU4ODUwMTAxNUAxNTg4NDE0NjE1\u0026q=http%3A%2F%2Fshomusbiology.weebly.com%2F","rootVe":83769}},"urlEndpoint":{"url":"/redirect?event=video_description\u0026v=N5-KubFjtHc\u0026redir_token=962PqshVlTHnPz8tg8dTFphkPgF8MTU4ODUwMTAxNUAxNTg4NDE0NjE1\u0026q=http%3A%2F%2Fshomusbiology.weebly.com%2F","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\nDownload the study materials here-\n"},{"text":"http://shomusbiology.weebly.com/bio-m...","navigationEndpoint":{"clickTrackingParams":"CJQBEM2rARgBIhMIv9GPx_mU6QIVGNDBCh2GDg4cSPfojoub1-LPNw==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?event=video_description\u0026v=N5-KubFjtHc\u0026redir_token=962PqshVlTHnPz8tg8dTFphkPgF8MTU4ODUwMTAxNUAxNTg4NDE0NjE1\u0026q=http%3A%2F%2Fshomusbiology.weebly.com%2Fbio-materials.html","rootVe":83769}},"urlEndpoint":{"url":"/redirect?event=video_description\u0026v=N5-KubFjtHc\u0026redir_token=962PqshVlTHnPz8tg8dTFphkPgF8MTU4ODUwMTAxNUAxNTg4NDE0NjE1\u0026q=http%3A%2F%2Fshomusbiology.weebly.com%2Fbio-materials.html","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\nVaccines work by presenting a foreign antigen to the immune system to evoke an immune response, but there are several ways to do this. Four main types are currently in clinical use:\n\n    An inactivated vaccine consists of virus or bacteria that are grown in culture and then killed using a method such as heat or formaldehyde. Although the virus or bacteria particles are destroyed and cannot replicate, the virus capsid proteins or bacterial wall are intact enough to be recognized and remembered by the immune system and evoke a response. When manufactured correctly, the vaccine is not infectious, but improper inactivation can result in intact and infectious particles. Since the properly produced vaccine does not reproduce, booster shots are required periodically to reinforce the immune response.\n    In an attenuated vaccine, live virus or bacteria with very low virulence are administered. They will replicate, but locally or very slowly. Since they do reproduce and continue to present antigen to the immune system beyond the initial vaccination, boosters may be required less often. These vaccines may be produced by passaging, for example, adapting a virus into different host cell cultures, such as in animals, or at suboptimal temperatures, allowing selection of less virulent strains, or by mutagenesis or targeted deletions in genes required for virulence. There is a small risk of reversion to virulence, which is smaller in vaccines with deletions. Attenuated vaccines also cannot be used by immunocompromised individuals. Reversions of virulence were described for a few attenuated viruses of chickens (infectious bursal disease virus, avian infectious bronchitis virus, avian infectious laryngotracheitis virus [3], avian metapneumovirus [4])[21]\n    Virus-like particle vaccines consist of viral protein(s) derived from the structural proteins of a virus. These proteins can self-assemble into particles that resemble the virus from which they were derived but lack viral nucleic acid, meaning that they are not infectious. Because of their highly repetitive, multivalent structure, virus-like particles are typically more immunogenic than subunit vaccines (described below). The human papillomavirus and Hepatitis B virus vaccines are two virus-like particle-based vaccines currently in clinical use.\n    A subunit vaccine presents an antigen to the immune system without introducing viral particles, whole or otherwise. One method of production involves isolation of a specific protein from a virus or bacterium (such as a bacterial toxin) and administering this by itself. A weakness of this technique is that isolated proteins may have a different three-dimensional structure than the protein in its normal context, and will induce antibodies that may not recognize the infectious organism. In addition, subunit vaccines often elicit weaker antibody responses than the other classes of vaccines.\n\nA number of other vaccine strategies are under experimental investigation. These include DNA vaccination and recombinant viral vectors. Source of the article published in description is Wikipedia. I am sharing their material. Copyright by original content developers of Wikipedia.\nLink- "},{"text":"http://en.wikipedia.org/wiki/Main_Page","navigationEndpoint":{"clickTrackingParams":"CJQBEM2rARgBIhMIv9GPx_mU6QIVGNDBCh2GDg4cSPfojoub1-LPNw==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?event=video_description\u0026v=N5-KubFjtHc\u0026redir_token=962PqshVlTHnPz8tg8dTFphkPgF8MTU4ODUwMTAxNUAxNTg4NDE0NjE1\u0026q=http%3A%2F%2Fen.wikipedia.org%2Fwiki%2FMain_Page","rootVe":83769}},"urlEndpoint":{"url":"/redirect?event=video_description\u0026v=N5-KubFjtHc\u0026redir_token=962PqshVlTHnPz8tg8dTFphkPgF8MTU4ODUwMTAxNUAxNTg4NDE0NjE1\u0026q=http%3A%2F%2Fen.wikipedia.org%2Fwiki%2FMain_Page","target":"TARGET_NEW_WINDOW","nofollow":true}}}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_DESTRUCTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Subscribe"}]},"navigationEndpoint":{"clickTrackingParams":"CJUBEJsrIhMIv9GPx_mU6QIVGNDBCh2GDg4c","commandMetadata":{"webCommandMetadata":{"ignoreNavigation":true}},"modalEndpoint":{"modal":{"modalWithTitleAndButtonRenderer":{"title":{"simpleText":"Want to subscribe to this channel?"},"content":{"simpleText":"Sign in to subscribe to this channel."},"button":{"buttonRenderer":{"style":"STYLE_BLUE_TEXT","size":"SIZE_DEFAULT","isDisabled":false,"text":{"simpleText":"Sign in"},"navigationEndpoint":{"clickTrackingParams":"CJYBEP2GBCITCL_Rj8f5lOkCFRjQwQodhg4OHDIJc3Vic2NyaWJl","commandMetadata":{"webCommandMetadata":{"url":"https://accounts.google.com/ServiceLogin?service=youtube\u0026uilel=3\u0026p {"videoId":"N5-KubFjtHc","title":"Vaccines part 2 - properties of vaccine","lengthSeconds":"339","keywords":["Mumps","molecular biology","Oral Vaccine","DNA","Immunogen","life sciences","Dna Vaccine","shomu's biology","Inactivated Vaccine","Immune System","Conjugated Vaccine","proteins","Antigen","Killed Vaccine","Introduction To Vaccination","Vaccination","Disease","Development Of Vaccine","suman bhattacharjee","biology education","Viral Vaccine","cell biology","Allergen","Polio Vaccine","Vaccination Process","Immune Response","Hapten","Live Attenuated Vaccine","Subunit Vaccine","Vaccine","teaching"],"channelId":"UCEPMCywJ6FPZpQ_aPEZt5JA","isOwnerViewing":false,"shortDescription":"For more information, log on to-\nhttp://shomusbiology.weebly.com/\nDownload the study materials here-\nhttp://shomusbiology.weebly.com/bio-materials.html\nVaccines work by presenting a foreign antigen to the immune system to evoke an immune response, but there are several ways to do this. Four main types are currently in clinical use:\n\n    An inactivated vaccine consists of virus or bacteria that are grown in culture and then killed using a method such as heat or formaldehyde. Although the virus or bacteria particles are destroyed and cannot replicate, the virus capsid proteins or bacterial wall are intact enough to be recognized and remembered by the immune system and evoke a response. When manufactured correctly, the vaccine is not infectious, but improper inactivation can result in intact and infectious particles. Since the properly produced vaccine does not reproduce, booster shots are required periodically to reinforce the immune response.\n    In an attenuated vaccine, live virus or bacteria with very low virulence are administered. They will replicate, but locally or very slowly. Since they do reproduce and continue to present antigen to the immune system beyond the initial vaccination, boosters may be required less often. These vaccines may be produced by passaging, for example, adapting a virus into different host cell cultures, such as in animals, or at suboptimal temperatures, allowing selection of less virulent strains, or by mutagenesis or targeted deletions in genes required for virulence. There is a small risk of reversion to virulence, which is smaller in vaccines with deletions. Attenuated vaccines also cannot be used by immunocompromised individuals. Reversions of virulence were described for a few attenuated viruses of chickens (infectious bursal disease virus, avian infectious bronchitis virus, avian infectious laryngotracheitis virus [3], avian metapneumovirus [4])[21]\n    Virus-like particle vaccines consist of viral protein(s) derived from the structural proteins of a virus. These proteins can self-assemble into particles that resemble the virus from which they were derived but lack viral nucleic acid, meaning that they are not infectious. Because of their highly repetitive, multivalent structure, virus-like particles are typically more immunogenic than subunit vaccines (described below). The human papillomavirus and Hepatitis B virus vaccines are two virus-like particle-based vaccines currently in clinical use.\n    A subunit vaccine presents an antigen to the immune system without introducing viral particles, whole or otherwise. One method of production involves isolation of a specific protein from a virus or bacterium (such as a bacterial toxin) and administering this by itself. A weakness of this technique is that isolated proteins may have a different three-dimensional structure than the protein in its normal context, and will induce antibodies that may not recognize the infectious organism. In addition, subunit vaccines often elicit weaker antibody responses than the other classes of vaccines.\n\nA number of other vaccine strategies are under experimental investigation. These include DNA vaccination and recombinant viral vectors. Source of the article published in description is Wikipedia. I am sharing their material. Copyright by original content developers of Wikipedia.\nLink- http://en.wikipedia.org/wiki/Main_Page","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/N5-KubFjtHc/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLC4lcA2_ZenLEun5s9bRI6aH9FM2A","width":168,"height":94},{"url":"https://i.ytimg.com/vi/N5-KubFjtHc/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLBs4c1_orpS5MH6d39qzHs82AG-XQ","width":196,"height":110},{"url":"https://i.ytimg.com/vi/N5-KubFjtHc/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLB8mRtAisc6UI4EjjgtsdqtWfunSA","width":246,"height":138},{"url":"https://i.ytimg.com/vi/N5-KubFjtHc/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLC8b-3-qkE5SzVnGoKMhtVVHqFq8Q","width":336,"height":188}]},"useCipher":false,"averageRating":4.8567495,"allowRatings":true,"viewCount":"41882","author":"Shomu's Biology","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"annotations":[{"playerAnnotationsExpandedRenderer":{"featuredChannel":{"startTimeMs":"0","endTimeMs":"340000","watermark":{"thumbnails":[{"url":"https://i.ytimg.com/an/EPMCywJ6FPZpQ_aPEZt5JA/featured_channel.jpg?v=550e4c95","width":51,"height":23}]},"trackingParams":"CBQQ8zciEwiHt4_H-ZTpAhVQ2mAKHU_MAEo=","navigationEndpoint":{"clickTrackingParams":"CBQQ8zciEwiHt4_H-ZTpAhVQ2mAKHU_MAEoyAml2","commandMetadata":{"webCommandMetadata":{"url":"/channel/UCEPMCywJ6FPZpQ_aPEZt5JA","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":3611}},"browseEndpoint":{"browseId":"UCEPMCywJ6FPZpQ_aPEZt5JA"}},"channelName":"Shomu's Biology","subscribeButton":{"subscribeButtonRenderer":{"buttonText":{"runs":[{"text":"SUBSCRIBE"}]},"subscribed":false,"enabled":true,"type":"FREE","channelId":"UCEPMCywJ6FPZpQ_aPEZt5JA","showPreferences":false,"subscribedButtonText":{"runs":[{"text":"SUBSCRIBED"}]},"unsubscribedButtonText":{"runs":[{"text" com/\nDownload the study materials here-\nhttp://shomusbiology.weebly.com/bio-materials.html\nVaccines work by presenting a foreign antigen to the immune system to evoke an immune response, but there are several ways to do this. Four main types are currently in clinical use:\n\n    An inactivated vaccine consists of virus or bacteria that are grown in culture and then killed using a method such as heat or formaldehyde. Although the virus or bacteria particles are destroyed and cannot replicate, the virus capsid proteins or bacterial wall are intact enough to be recognized and remembered by the immune system and evoke a response. When manufactured correctly, the vaccine is not infectious, but improper inactivation can result in intact and infectious particles. Since the properly produced vaccine does not reproduce, booster shots are required periodically to reinforce the immune response.\n    In an attenuated vaccine, live virus or bacteria with very low virulence are administered. They will replicate, but locally or very slowly. Since they do reproduce and continue to present antigen to the immune system beyond the initial vaccination, boosters may be required less often. These vaccines may be produced by passaging, for example, adapting a virus into different host cell cultures, such as in animals, or at suboptimal temperatures, allowing selection of less virulent strains, or by mutagenesis or targeted deletions in genes required for virulence. There is a small risk of reversion to virulence, which is smaller in vaccines with deletions. Attenuated vaccines also cannot be used by immunocompromised individuals. Reversions of virulence were described for a few attenuated viruses of chickens (infectious bursal disease virus, avian infectious bronchitis virus, avian infectious laryngotracheitis virus [3], avian metapneumovirus [4])[21]\n    Virus-like particle vaccines consist of viral protein(s) derived from the structural proteins of a virus. These proteins can self-assemble into particles that resemble the virus from which they were derived but lack viral nucleic acid, meaning that they are not infectious. Because of their highly repetitive, multivalent structure, virus-like particles are typically more immunogenic than subunit vaccines (described below). The human papillomavirus and Hepatitis B virus vaccines are two virus-like particle-based vaccines currently in clinical use.\n    A subunit vaccine presents an antigen to the immune system without introducing viral particles, whole or otherwise. One method of production involves isolation of a specific protein from a virus or bacterium (such as a bacterial toxin) and administering this by itself. A weakness of this technique is that isolated proteins may have a different three-dimensional structure than the protein in its normal context, and will induce antibodies that may not recognize the infectious organism. In addition, subunit vaccines often elicit weaker antibody responses than the other classes of vaccines.\n\nA number of other vaccine strategies are under experimental investigation. These include DNA vaccination and recombinant viral vectors. Source of the article published in description is Wikipedia. I am sharing their material. Copyright by original content developers of Wikipedia.\nLink- http://en.wikipedia.org/wiki/Main_Page"},"lengthSeconds":"340","ownerProfileUrl":"http://www.youtube.com/user/TheFunsuman","externalChannelId":"UCEPMCywJ6FPZpQ_aPEZt5JA","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","H
